package com.citi.retail.optima.etl.cache.model;

/**
 * @author mc56120
 *
 */
public class CountryVO {

	private String countryCode;
	private String countryDescr;
	/**
	 * @return the countryCode
	 */
	public String getCountryCode() {
		return countryCode;
	}
	/**
	 * @param countryCode the countryCode to set
	 */
	public void setCountryCode(String countryCode) {
		this.countryCode = countryCode;
	}
	/**
	 * @return the countryDescr
	 */
	public String getCountryDescr() {
		return countryDescr;
	}
	/**
	 * @param countryDescr the countryDescr to set
	 */
	public void setCountryDescr(String countryDescr) {
		this.countryDescr = countryDescr;
	}

	
}
